import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Priapisme } from 'src/app/models/Priapisme';
import { PriapismeService } from 'src/app/services/priapisme.service';

@Component({
  selector: 'app-priapisme',
  templateUrl: './priapisme.component.html',
  styleUrls: ['./priapisme.component.css']
})
export class PriapismeComponent {
  complications: Priapisme[] = [new Priapisme()];
  errorMessage: string = '';
  patientId: string | null = null;

  constructor(private PriapismeService: PriapismeService,private router:Router) {}
  ngOnInit(): void {
    // Retrieve the PatientId from local storage
    this.patientId = localStorage.getItem('patientId');
  
    if (this.patientId && this.patientId !== '0') {
      console.log('Patient ID retrieved from local storage:', this.patientId);
    } else {
      console.error('No valid Patient ID found in local storage.');
    }
  }
  addComplication() {
    this.complications.push(new Priapisme());
  }

  onSubmit() {
    this.errorMessage = ''; // Clear previous errors
    this.complications.forEach(complication => {
      this.PriapismeService.addpriapisme(complication).subscribe(
        response => {
          console.log('Complication added successfully', response);
          // Navigate to the next page with the patientId
          if (this.patientId) {
            this.router.navigate(['admin/thrombose', this.patientId]).then(() => {
              console.log('Navigated to the next page with patientId:', this.patientId);
            }).catch(err => {
              console.error('Navigation error:', err);
            });
          } else {
            console.error('No patientId found. Navigation aborted.');
          }
        },
        (error: HttpErrorResponse) => {
          console.error('Error adding complication', error);
          this.errorMessage = error.error.title || 'An error occurred while adding the complication.';
          if (error.error.errors) {
            for (const [field, errors] of Object.entries(error.error.errors)) {
              console.error(`Validation error for ${field}:`, errors);
            }
          }
        }
      );
    });
  }
}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    .form-container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 20px;
      background-color: #f0f0f0;
    }
    .form-container h1, .form-container h2 {
      text-align: center;
      font-weight: bold;
      font-family: 'Arial', sans-serif;
      text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
      padding-bottom: 10px;
      display: inline-block;
      margin-bottom: 30px;
    }
    .form-container h1 {
      font-size: 36px;
      color: #2c3e50;
      border-bottom: 3px solid #3498db;
    }
    .form-container h2 {
      font-size: 30px;
      color: #c95355;
      border-bottom: 3px solid #f12349;
    }
    .form-container form {
      background-color: #f9f9f9;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    }
    .form-container form div {
      margin-bottom: 15px;
    }
    .form-container form label {
      display: block;
      margin-bottom: 5px;
      font-weight: bold;
      text-transform: capitalize;
    }
    .form-container form input, .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
    }
    .form-container form .submit-row {
      text-align: center;
      margin-top: 20px;
    }
    .form-container form input[type="submit"] {
      background-color: #000 !important;
      color: #fff !important;
      padding: 12px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }
    .form-container form input[type="submit"]:hover {
      background-color: #444;
      color: #fff;
    }
    .form-container form select {
      background-color: #fff;
      font-size: 16px;
      cursor: pointer;
      appearance: none;
      -webkit-appearance: none;
      -moz-appearance: none;
      background-image: url('data:image/svg+xml;utf8,<svg fill="currentColor" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M7.68 11.895a.75.75 0 0 1-1.06-1.06L7.94 9.44V5.75a.75.75 0 0 1 1.5 0v3.69l1.32 1.33a.75.75 0 0 1-1.06 1.06L8 10.56l-.32.32z"/></svg>');
      background-repeat: no-repeat;
      background-position: right 10px top 50%, 0 0;
      background-size: 16px auto, 100%;
    }
    .radio-group {
      display: flex;
      align-items: center;
      gap: 15px;
    }
    .radio-group input[type="radio"] {
      margin-right: 5px;
    }
    .radio-group label {
      margin: 0;
    }
    .checkbox-group {
      display: flex;
      flex-wrap: wrap;
      gap: 10px;
    }
    .checkbox-group label {
      display: flex;
      align-items: center;
      gap: 5px;
    }
  </style>
</head>
<body>
  <div class="form-container">
    <form (ngSubmit)="onSubmit()">
      <div *ngFor="let complication of complications; let i = index">
        <h1>Priapiseme- {{ i + 1 }}</h1>

        

        <!-- Priapisme1 -->
        <div>
          <label>Priapisme:</label>
          <div class="radio-group">
            <input type="radio" id="Priapisme1Oui-{{i}}" [(ngModel)]="complication.Priapisme1" [value]="true" name="Priapisme1-{{i}}">
            <label for="Priapisme1Oui-{{i}}">Oui</label>
            <input type="radio" id="Priapisme1Non-{{i}}" [(ngModel)]="complication.Priapisme1" [value]="false" name="Priapisme1-{{i}}">
            <label for="Priapisme1Non-{{i}}">Non</label>
          </div>
        </div>

        <!-- Nombre -->
        <div *ngIf="complication.Priapisme1">
          <label for="Nombre-{{i}}">Nombre:</label>
          <input type="number" id="Nombre-{{i}}" [(ngModel)]="complication.Nombre" name="Nombre-{{i}}">
        </div>

        <!-- Date -->
        <div *ngIf="complication.Priapisme1">
          <label for="Date-{{i}}">Date :</label>
          <input type="date" id="Date-{{i}}" [(ngModel)]="complication.Date" name="Date-{{i}}">
        </div>
         <!-- HeureSurvenue -->
         <div *ngIf="complication.Priapisme1">
            <label for="HeureSurvenue-{{i}}">Heure Survenue :</label>
            <input type="date" id="HeureSurvenue-{{i}}" [(ngModel)]="complication.HeureSurvenue" name="HeureSurvenue-{{i}}">
          </div>
           <!-- DureeEpisode -->
         <div *ngIf="complication.Priapisme1">
            <label for="DureeEpisode-{{i}}">Durée de l'épisode (minute)  :</label>
            <input type="number" id="DureeEpisode-{{i}}" [(ngModel)]="complication.DureeEpisode" name="DureeEpisode-{{i}}">
          </div>
        
  

        <!-- Symptomatologie -->
        <div class="conditional-fields" *ngIf="complication.Priapisme1">
            <label for="Symptomatologie-{{i}}">Symptomatologie:</label>
            <div class="checkbox-group">
              <label>
                <input type="checkbox" id="ErectionDoulouruse-{{i}}" [(ngModel)]="complication.ErectionDoulouruse" name="ErectionDoulouruse-{{i}}">
                Erection douloureuse
              </label>
              <label>
                <input type="checkbox" id="ErectionNonDouloureuse-{{i}}" [(ngModel)]="complication.ErectionNonDouloureuse" name="ErectionNonDouloureuse-{{i}}">
                Erection Non Douloureuse
              </label>
              
              <label>
                <input type="checkbox" id="Autre-{{i}}" [(ngModel)]="complication.Autre" name="Autre-{{i}}">
                Autre
              </label>
            </div>
          </div>
          <!-- Preciser autre -->
        <div *ngIf="complication.Priapisme1 && complication.Autre">
            <label for="PreciserAutre-{{i}}">Preciser Autre:</label>
            <input type="text" id="PreciserAutre-{{i}}" [(ngModel)]="complication.PreciserAutre" name="PreciserAutre-{{i}}">
          </div>

           <!-- Hospitalisation -->
         <div *ngIf="complication.Priapisme1">
            <label for="Hospitalisation-{{i}}"> Hospitalisation:</label>
            <input type="checkbox" id="Hospitalisation-{{i}}" [(ngModel)]="complication.Hospitalisation" name="Hospitalisation-{{i}}">
          </div>
           <!-- Lieu hospitalisation -->
         <div *ngIf="complication.Priapisme1 && complication.Hospitalisation">
            <label for="LieuHospitalisation-{{i}}">Lieu Hospitalisation:</label>
            <input type="text" id="LieuHospitalisation-{{i}}" [(ngModel)]="complication.LieuHospitalisation" name="LieuHospitalisation-{{i}}">
          </div>
    

        <!-- Traitement -->
        <div class="conditional-fields" *ngIf="complication.Priapisme1">
          <label for="Traitement-{{i}}">Traitement:</label>
          <div class="checkbox-group">
            <label>
              <input type="checkbox" id="AntalgiquesPalliesI-{{i}}" [(ngModel)]="complication.AntalgiquesPalliesI" name="AntalgiquesPalliesI-{{i}}">
              Antalgiques pallier I
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIi-{{i}}" [(ngModel)]="complication.AntalgiquePallierIi" name="AntalgiquePallierIi-{{i}}">
              Antalgique pallier II
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIii-{{i}}" [(ngModel)]="complication.AntalgiquePallierIii" name="AntalgiquePallierIii-{{i}}">
              Antalgique pallier III
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationPerso-{{i}}" [(ngModel)]="complication.HyperhydratationPerso" name="HyperhydratationPerso-{{i}}">
              Hyperhydratation perso
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationIv-{{i}}" [(ngModel)]="complication.HyperhydratationIv" name="HyperhydratationIv-{{i}}">
              Hyperhydratation IV
            </label>
            <label>
              <input type="checkbox" id="TransfusionSimple-{{i}}" [(ngModel)]="complication.TransfusionSimple" name="TransfusionSimple-{{i}}">
              Transfusion simple
            </label>
            <label>
                <input type="checkbox" id="EchangeTransfusionnel-{{i}}" [(ngModel)]="complication.EchangeTransfusionnel" name="EchangeTransfusionnel-{{i}}">
                Echange transfusionnel
              </label>
            
          </div>
        </div>
 
        <div *ngIf="complication.Priapisme1">
            <label>Résolution Spontanée:</label>
            <div class="radio-group">
              <input type="radio" id="ResolutionSpontaneeOui-{{i}}" [(ngModel)]="complication.ResolutionSpontanee" [value]="true" name="ResolutionSpontanee-{{i}}">
              <label for="ResolutionSpontaneeOui-{{i}}">Oui</label>
              <input type="radio" id="ResolutionSpontaneeNon-{{i}}" [(ngModel)]="complication.ResolutionSpontanee" [value]="false" name="ResolutionSpontanee-{{i}}">
              <label for="ResolutionSpontaneeNon-{{i}}">Non</label>
            </div>
          </div>
           <!-- Duree Priapisme -->
         <div *ngIf="complication.ResolutionSpontanee && complication.Priapisme1">
            <label for="DureePriapisme-{{i}}">Durée du priapisme (min)   </label>
            <input type="number" id="DureePriapisme-{{i}}" [(ngModel)]="complication.DureePriapisme" name="DureePriapisme-{{i}}">
          </div>


          <div *ngIf="complication.Priapisme1">
            <label>Traitement médical spécique:</label>
            <div class="radio-group">
              <input type="radio" id="TraitementMedicalSpecifiqueOui-{{i}}" [(ngModel)]="complication.TraitementMedicalSpecifique" [value]="true" name="TraitementMedicalSpecifique-{{i}}">
              <label for="TraitementMedicalSpecifiqueOui-{{i}}">Oui</label>
              <input type="radio" id="TraitementMedicalSpecifiqueNon-{{i}}" [(ngModel)]="complication.TraitementMedicalSpecifique" [value]="false" name="TraitementMedicalSpecifique-{{i}}">
              <label for="TraitementMedicalSpecifiqueNon-{{i}}">Non</label>
            </div>
          </div>
           <!-- DelaiTraitementMedical -->
         <div *ngIf="complication.TraitementMedicalSpecifique && complication.Priapisme1">
            <label for="DelaiTraitementMedical-{{i}}">Délai entre début priapisme et début traitement médical (min) </label>
            <input type="number" id="DelaiTraitementMedical-{{i}}" [(ngModel)]="complication.DelaiTraitementMedical" name="DelaiTraitementMedical-{{i}}">
          </div>
             <!-- Type traitement -->
         <div *ngIf="complication.TraitementMedicalSpecifique && complication.Priapisme1">
            <label for="TypeTraitementMedical-{{i}}">Type traitement </label>
            <input type="text" id="TypeTraitementMedical-{{i}}" [(ngModel)]="complication.TypeTraitementMedical" name="TypeTraitementMedical-{{i}}">
          </div>


          <div *ngIf="complication.Priapisme1">
            <label>Traitement chirurgical: </label>
            <div class="radio-group">
              <input type="radio" id="TraitementChirurgicalOui-{{i}}" [(ngModel)]="complication.TraitementChirurgical" [value]="true" name="TraitementChirurgical-{{i}}">
              <label for="TraitementChirurgicalOui-{{i}}">Oui</label>
              <input type="radio" id="TraitementChirurgicalNon-{{i}}" [(ngModel)]="complication.TraitementChirurgical" [value]="false" name="TraitementChirurgical-{{i}}">
              <label for="TraitementChirurgicalNon-{{i}}">Non</label>
            </div>
          </div>
           <!-- DelaiTraitementMedical -->
         <div *ngIf="complication.TraitementChirurgical && complication.Priapisme1">
            <label for="DelaiTraitementChirurgical-{{i}}">Ddélai entre début priapisme et début traitement chirurgical (min)  </label>
            <input type="number" id="DelaiTraitementChirurgical-{{i}}" [(ngModel)]="complication.DelaiTraitementChirurgical" name="DelaiTraitementChirurgical-{{i}}">
          </div>
             <!-- Type traitement -->
         <div *ngIf="complication.TraitementChirurgical && complication.Priapisme1">
            <label for="TypeTraitementChirurgical-{{i}}">Type traitement </label>
            <input type="text" id="TypeTraitementChirurgical-{{i}}" [(ngModel)]="complication.TypeTraitementChirurgical" name="TypeTraitementChirurgical-{{i}}">
          </div>

      </div>
      
      
      <div class="submit-row">
        <input type="button" (click)="addComplication()" value="Ajouter Crise ">
      </div>
      <div class="submit-row">
        <input type="submit" value="Submit">
      </div>
    </form>
  </div>
</body>
</html>
